import React from 'react'
import { Row, Col, Table } from 'reactstrap'
import { Dropdown, DropdownToggle, DropdownMenu, DropdownItem } from 'reactstrap';

var data2 = require('./generated.json');
var pizza = require('./drivers.json');

class Example extends React.Component {
    constructor(props) {
      super(props);
      
      this.handleChange = this.handleChange.bind(this);
      this.toggle = this.toggle.bind(this);
      this.state = {
        dropdownOpen: false,
        value: 'ASSURITY'
      };
    }
  
    toggle() {
      this.setState(prevState => ({
        dropdownOpen: !prevState.dropdownOpen
      }));
    }

    handleChange(e) {
        this.setState({value: event.target.value});
    }

    render() {
        const test = data2.filter(data2 => data2.company === this.state.value);
        const test2 = test[0];
        const driver1 = pizza.filter(pizza => pizza.company === this.state.value);
        const driver2 = 5;
        const stupid = pizza.filter(pizza => pizza.training.type === "CPR");
        const stupid2 = JSON.stringify(stupid);


        var count = {};
        test2.drivers.map(function (arr, i) {
         arr.training.type.map(function (type, k) {
          count[type] = (count[type] || 0) + 1;
         });
        });
        










        return (
            <div className="ml-5 mt-5">
                <Dropdown isOpen={this.state.dropdownOpen} toggle={this.toggle}>
                    <DropdownToggle caret>
                        Provider List
                    </DropdownToggle>
                    <DropdownMenu
                        modifiers={{
                        setMaxHeight: {
                            enabled: true,
                            order: 890,
                            fn: (data) => {
                            return {
                                ...data,
                                styles: {
                                ...data.styles,
                                overflow: 'auto',
                                maxHeight: 200  ,
                                },
                            };
                            },
                        },
                        }}
                    >
                        {
                            data2.sort((a, b) => {
                                const One = a.company.toUpperCase();
                                const Two = b.company.toUpperCase();
                            
                                return (One < Two) ? -1 : (One > Two) ? 1 : 0;
                            })
                            .map(TP => (
                                <DropdownItem className="Btn" key={TP.company} onClick={this.handleChange}
                                value={TP.company}>
                                    {TP.company}
                                </DropdownItem>
                            ))
                        }
                    </DropdownMenu>
                </Dropdown>
                <div>

                        <p>{count}</p>
                

        
                <p>Provider: {this.state.value}</p>
                <p><span className="ml-5">email: {test2.email}, </span>
                <span className="ml-5">phone: {test2.phone}, </span>
                <span className="ml-5">address: {test2.address}, </span>
                </p>
                <p>Insurance:</p>
                {
                    test2.insurance.map(insurance => (
                        <span className="ml-5" key={insurance.type}>
                            <span className="ml-5">{insurance.type}</span>
                            <span className="ml-5">{insurance.company}</span>
                            <span className="ml-5">{insurance.end}</span>
                        </span>
                    ))
                }
                <p>Drivers:</p>


                

                {
                    driver1.map(dr => (
                        <p key={dr.id}>
                            {dr.name}
                        </p>
                    ))
                }




                {
                    test2.drivers.map(driver => (
                        <Row>
                        <Col xs="auto" className="ml-5 p-0" key={driver.id}>
                        <div>  
                            <p>{driver.name}</p>
                            <p>License State: {driver.license.state}</p>
                            <p>License Exp: {driver.license.exp}</p>
                        </div>
                        </Col>
                        <Col xs="6" sm="4" className="m-0 p-0">
                            <p>Training:</p>
                            {driver.training.map(tr => (
                                <div className="ml-5" key={tr.type}>
                                    <span>Type: {tr.type}: </span>
                                    <span>{tr.company}</span>
                                    <span>{tr.end}</span>
                                </div>
                            ))}
                        </Col>
                        <Col xs="6" sm="4" className="m-0 p-0">
                            <p>Screening:</p>
                            {driver.screenings.map(scr => (
                                <div className="ml-5" key={scr.type}>
                                    <span>{scr.type}</span>
                                    <span>{scr.end}</span>
                                </div>
                            ))}
                        </Col>
                        </Row>
                    ))
                }
                </div>
            </div>
        );
    }
}

export default Example;
